import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>REACT MOVIE APP</h1>
        <div className="movie-container">
          <div className="movie-wrapper">

          <img className="movie-wrapper"/>
          </div>
        </div>
        </header>
    </div>
  );
}

export default App;
